(4, 'User Agreement', 'user-agreement', '<p style=\"text-align: justify; \">\n                            Please read these terms carefully. Bhatiyani Enterprise Private Limited (hereinafter referred to as the Company) has created an intermediary online platform by the name Rigoride Drivers, (hereinafter referred to as the App, Platform or Rigoride) which acts as an intermediary e-commerce marketplace facilitating drivers to connect with potential customers. The marketplace is a platform for taxi drivers to transact with third party customers, who have been granted access to the App. The Company does not provide any services to users other than providing the marketplace as a platform to transact at their own cost and risk, and other services as may be specifically be notified in writing. The Company is not and cannot be a party to any transaction between you and the third-party sellers or taxi driver, or have any control, involvement or influence over the products purchased by you or services received by you from such third-party sellers / taxi drivers. (Hereinafter together referred to a Services). The said Products and Services are described in detail in clause 4 hereunder.\n\n                        </p>\n                        <p style=\"text-align: justify;\">\n                            By accessing and/or using the Rigoride Drivers application (APP) the taxi driver acknowledges that he/she has read understood and agrees to be legally bound by the terms and conditions set forth in this document. If you do not agree to abide by thus User Agreement (the Agreement), you are not permitted to access or use the App. All text, graphics, design, content, and other works are copyrighted works of Company. The Company acknowledges proprietary rights of third parties displayed on the App.\n                        </p>\n                        <p style=\"text-align: justify;\">\n                            For purpose of this Agreement the terms we, us or our, refer to Rigoride Drivers App or Company user interchangeably. When you use the services available on the App, you consent to our collection, use, and disclosure of information about you as described in this Agreement displayed on the App. The information contained on or linked to this App is general information only. Nothing on this App is or purports to be advice. You should not rely on any information on or linked to this App. If you need advice, you should seek personal professional advice based on your own circumstances.\n                        </p>\n\n                        <h5 style=\"text-align: justify;\">ACCEPTANCE OF TERMS</h5>\n                        <p style=\"text-align: justify;\">\n                            The services that we at Rigoride Drivers provide to user is subject to the following terms and conditions:\n                        </p>\n                        <ul>\n                            <li style=\"text-align: justify;\">This Agreement governs the use of certain specific material contained on the App, sets forth the terms and conditions that apply to use of the App by the taxi driver (User). By using the App, user agrees to comply with all of the terms and conditions hereof. The right to use App is personal to user and is not transferable to any other person or entity. User is responsible for all use of users account (under any screen name or password) and for ensuring that all use of users account complies fully with the provisions of this Agreement. User shall be responsible for protecting the confidentiality of users password(s), if any.\n                            </li>\n                            <li style=\"text-align: justify;\">We shall have the right at any time to change or discontinue any aspect or feature of App, including, but not limited to, content, material, and third-party communication link1 (herein after referred to as Third Party Apps) needed for access or use.\n\n                            </li>\n                        </ul>\n                        <h6 style=\"text-align: justify;\">SERVICES AND CONTRACT\n                        </h6>\n                        <ul>\n                            <li style=\"text-align: justify;\">On the App, you have the ability to compare third party products and services, including discounts being offered by such third parties on the sale of its products and services.\n                             </li>\n                            <li style=\"text-align: justify;\">We allow or provide access to Apps hosted by other third parties, including the possibility to compare various services offered by third parties.\n                            </li>\n                        </ul>\n\n                        <h6 style=\"text-align: justify;\">Changed Terms\n                        </h6>\n                        <p style=\"text-align: justify;\">The Company shall have the right at any time to change or modify the terms and conditions applicable to users use of App, or any part thereof, or to impose new conditions, including, but not limited to, adding fees and charges for use. Such changes, modifications, additions or deletions shall be effective immediately upon notice thereof, which may be given by means including, but not limited to, posting on App, or by electronic or conventional mail, or by any other means by which user obtains notice thereof. Any use of App by user after such notice shall be deemed to constitute acceptance by user of such changes, modifications or additions.\n                        </p>\n\n                        <h6 style=\"text-align: justify;\">description of services\n                        </h6>\n                        <p style=\"text-align: justify;\">through the app, we provide users with access to a variety of services, as described in detail hereunder:</p>\n                            <ul>\n                                <li style=\"text-align: justify;\">\n                                    the services constitute a technology platform that enables users of jugnoos mobile application or app provided as part of the services to arrange and schedule transportation and/or logistics services with independent third-party providers of such services, including independent third-party transportation providers and independent third-party logistics providers under agreement with Rigoride or certain of Rigorides affiliates (third party providers). unless otherwise agreed by Rigoride in a separate written agreement with you, the services are made available solely for your personal, non-commercial use. you acknowledge that Rigoride does not provide transportation or logistics services or function as a transportation carrier and that all such transportation or logistics services are provided by independent third-party contractors who are not employed by Rigoride or any of its affiliates.\n                                </li>\n                                <li style=\"text-align: justify;\">\n                                    the company is a technology company that does not provide or engage in transportation services and the company is not a transportation provider. the software and the application are intended to be used for facilitating you (as a transportation provider) to offer your transportation services to your passenger or customer. the company is not responsible or liable for the acts and/or omissions of any services you provided to your passengers, and for any illegal action committed by you. you shall, at all time, not claim or cause any person to misunderstand that you are the agent, employee or staff of the company, and the services provided by you is not, in anyway, be deemed as services of the company.\n                                </li>\n                            </ul>\n\n                        <h6 style=\"text-align: justify;\">Equipment</h6>\n                        <p style=\"text-align: justify;\">\n                            User shall be responsible for obtaining and maintaining all telephone, computer hardware, software and other equipment needed for access to and use of App and all charges related thereto.\n                        </p>\n                        <ul>\n                            <li style=\"text-align: justify;\">Acceptance of Googles terms of use:</li>\n                        </ul>\n                        <p style=\"text-align: justify;\">We hereby agree and accept Googles terms of service, for our application outlined at the following links:</p>\n                        <div style=\"text-align: justify;\"><a href=\"https://www.google.com/help/terms_maps.html\" target=\"_blank\" style=\"font-size: 1rem;\">Google Maps/Google Earth Additional Terms of Service</a><a href=\"https://www.google.com/help/terms_maps.html\" target=\"_blank\"><br></a></div>\n                        <div style=\"text-align: justify;\"><a href=\"https://privacy.google.com/businesses/mapscontrollerterms/\" target=\"_blank\" style=\"font-size: 1rem;\">Google Maps Co-Controller Data Protection Terms</a><a href=\"https://privacy.google.com/businesses/mapscontrollerterms/\" target=\"_blank\"><br></a></div>\n                        <div style=\"text-align: justify;\"><a href=\"https://www.google.com/help/terms_maps.html\" target=\"_blank\" style=\"font-size: 1rem;\">Google Maps/Google Earth Additional Terms of Services</a><a href=\"https://www.google.com/help/terms_maps.html\" target=\"_blank\"><br></a></div><ul>\n                            <li style=\"text-align: justify;\">By using the App, you represent, warrant, undertake and agree that: You possess a valid drivers license and are authorized to operate a motor vehicle and have all the appropriate licenses, approvals and authority to provide transportation for hire to third parties in the jurisdiction in which you use the service; You own, or have the legal right and authority to operate, the vehicle which you intend to use when accepting passengers or customers, and such vehicle is in good operating condition and meets the industry safety standards for vehicles of its kind; You have a valid policy of liability insurance (in industry-standard coverage amounts) for the operation of your motor vehicle/passenger vehicle and/or business insurance to cover any anticipated losses related to the operation of a taxi/passenger delivery service; You shall be solely responsible for any and all claims, judgments and liabilities resulting from any accident, loss or damage including, but not limited to personal injuries, death, total loss and property damages which is due to or is alleged to be a result of the motor/passenger vehicle and/or taxi/passenger delivery service howsoever operated; You shall obey all local laws related to the operation of a taxi/passenger/customer delivery service and will be solely responsible for any violations of such local laws; You will only use the service for lawful purposes; You will only use the service for the purpose for which it is intended to be used; You will not use the Application for sending or storing any unlawful material or for fraudulent purposes; You will not use the Application and/or the Software to cause nuisance, annoyance, inconvenience or make fake bookings; You will not use the Service, Application and/or Software for purposes other than obtaining the Service; You shall not contact the Third Party Transportation Provider for purposes other than the Service; You will not impair the proper operation of the network; You will not try to harm the Service, Application and/or the Software in any way whatsoever; You will not copy, or distribute the Software or other content without written permission from the Company; You will only use the Software and/or the Application for your own use and will not resell it to a third party; You will keep secure and confidential your account password or any identification we provide you which allows access to the Service; You will provide us with whatever proof of identity we may reasonably request or require; You agree to provide accurate, current and complete information as required for the Service and undertake the responsibility to maintain and update your information in a timely manner to keep it accurate, current and complete at all times during the term of the Agreement. You agree that the Company may rely on your information as accurate, current and complete. You acknowledge that if your information is untrue, inaccurate, not current or incomplete in any respect, the Company has the right but not the obligation to terminate this Agreement and your use of the Service at any time with or without notice; You will only use an access point or data account (AP) which you are authorized to use; You shall not employ any means to defraud the Company or enrich yourself, through any means, whether fraudulent or otherwise, whether or not through any event, promotion or campaign launched by the Company to encourage new subscription or usage of the Service by new or existing passengers; You are aware that when responding to Passengers or Customers requests for transportation services, standard telecommunication charges will apply and which shall be solely borne by you; You shall not impair or circumvent the proper operation of the network which the Service operates on.</li>\n                        </ul>\n\n                        <h5 style=\"text-align: justify;\">User Conduct</h5>\n                        <ul>\n                            <li style=\"text-align: justify;\">User shall use the App for lawful purposes only. User shall not post or transmit through the App any material which violates or infringes in any way upon the rights of others, which is unlawful, threatening, abusive, defamatory, invasive of privacy or publicity rights, vulgar, obscene, profane or otherwise objectionable, which encourages conduct that would constitute a criminal offense, give rise to civil liability or otherwise violate any law, or which, without our express prior approval, contains advertising or any solicitation with respect to Products and Services. Any conduct by user that in our discretion restricts or inhibits any other user from using or enjoying the App will not be permitted.</li>\n                            <li style=\"text-align: justify;\">The App contains copyrighted material, trademarks and other proprietary information, including, but not limited to, text, photos, graphics which may belong to third parties and is copyrighted as a collective work under respective copyright laws. Rigoride acknowledges the proprietary rights of other parties mentioned on our App.</li>\n                            <li style=\"text-align: justify;\">User may not modify, publish, copy, reproduce, transmit, participate in the transfer or sale, create derivative works, or in any way exploit, any of the content, in whole or in part, except as otherwise expressly permitted under copyright law, no copying, redistribution, retransmission, publication or commercial exploitation of Apps material will be permitted without express permission of the Company and / or the copyright owner.</li>\n                            <li style=\"text-align: justify;\">User acknowledges that it does not acquire any ownership rights by downloading copyrighted material. The User shall not upload, post or otherwise make available on the App any material protected by copyright, trademark or any other proprietary right without express permission of the owner of the copyright, trademark or other proprietary right and the burden of determining that any material is not protected by copyright rests with user. User shall be solely liable for any damage resulting from any infringement of copyrights, proprietary rights, or any other harm resulting from such a submission. By submitting material to any public area or the App, user automatically grants or warrants that the owner of such material has expressly granted Rigoride royalty-free, perpetual, irrevocable, non-exclusive right and license to use, reproduce, modify, adapt, publish, translate and distribute such material (in whole or in part) world-wide and/or to incorporate it in other works in any form, media or technology now known or hereafter developed for the full term of any copyright that may exist in such material. User also permits any other user to access, view, and store or reproduce the material for that users personal use. User hereby grants the Company the right to edit, copy, publish and distribute any material made available on the App by user.</li>\n                        </ul>\n\n                        <h6 style=\"text-align: justify;\">MEMBER ACCOUNT, PASSWORD, AND SECURITY</h6>\n                        <p style=\"text-align: justify;\">\n                            If any of our services require user to open an account, user must complete the registration process by providing us with current, complete and accurate information as prompted by the applicable registration form. User also will choose a password and a user name. User is entirely responsible for maintaining the confidentiality of users password and account. Furthermore, user is entirely responsible for any and all activities that occur under users account. User agrees to notify the Company immediately of any unauthorized use of users account or any other breach of security. The Company will not be liable for any loss that user may incur as a result of someone else using users password or account, either with or without users knowledge. However, user could be held liable for losses incurred by the Company or another party due to someone else using users account or password. User may not use anyone elses account at any time, without the permission of the account holder.\n                        </p>\n\n                        <h6 style=\"text-align: justify;\">Limitation of Liability</h6>\n                        <ul>\n                            <li style=\"text-align: justify;\">User expressly agrees that use of the App is at users sole risk. Neither the Company, its affiliates nor any of their respective employees, agents, third party content providers or licensors warrant that the App will be uninterrupted or error free; nor do they make any warranty as to the results that may be obtained from use of App, or as to the accuracy, reliability or content of any information, service, or merchandise provided through the App. Company is not liable for any delay in food delivery or if the food delivered is old, not as per specifications of the order or stale. Payments once made will be refunded based upon genuinely refund. Refunds will only be processed via the Companys Rigoride Cash refund process only.</li>\n                            <li style=\"text-align: justify;\">The App is provided on an as is basis without warranties of any kind, either express or implied, including, but not limited to, warranties of title or implied warranties of merchantability or fitness for a particular purpose, other than those warranties which are implied by and incapable of exclusion, restriction or modification under the laws applicable to this Agreement.</li>\n                            <li style=\"text-align: justify;\">Notice of liability: despite regular controls, the Company is not liable for the content of external third party Apps. The owners of these Apps are fully responsible for the content of the linked pages. Please contact us if you notice external pages with illegal or immoral content. The legal information in this Agreement also applies to the Companys social media outlets, such as Facebook, Google+, Twitter, LinkedIn and the like.\n                            </li>\n                            <li style=\"text-align: justify;\">This limitation of liability applies to any damages or injury caused by any failure of performance, error, omission, interruption, deletion, defect, delay in operation or transmission, computer virus, communication line failure, theft or destruction or unauthorized access to, alteration of, or use of record, whether for breach of contract, tortuous behavior, negligence, or under any other cause of action. User specifically acknowledges that Rigoride is not liable for defamatory, offensive or illegal conduct of other users or third-parties and that the risk of injury from the foregoing rests entirely with user.\n                            </li>\n                            <li style=\"text-align: justify;\">In no event will user or any person or entity involved in creating the App be liable for any damages, including, without limitation, direct, indirect, incidental, special, and consequential or punitive damages arising out of the use of or inability to use App. User hereby acknowledges that the provisions of this section shall apply to all content on the App.</li>\n                            <li style=\"text-align: justify;\">In addition to the terms set forth above neither, Jugnoo nor its affiliates, information providers or content partners shall be liable regardless of the cause or duration, for any errors, inaccuracies, omissions, or other defects in, or untimeliness or unauthenticity of the information contained within the App, or for any delay or interruption in the transmission thereof to the user, or for any claims or losses arising there from or occasioned thereby. None of the foregoing parties shall be liable for any third-party claims or losses of any nature, including, but not limited to, lost profits, punitive or consequential damages.</li>\n                            <li style=\"text-align: justify;\">Force majeure  Jugnoo will not be responsible for any failure or delay in performance due to circumstances beyond its reasonable control, including, without limitation, acts of god, war, riot, embargoes, acts of civil or military authorities, fire, floods, accidents, service outages resulting from equipment and/or software failure and/or telecommunications failures, powe